ont-size: 14px;\" /><br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<img data-=\"\" data-fail=\"0\" data-ratio=\"1.3333333333333333\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"960\" src=\"/uploads/170731/170731/1-1FI11040409B.jpg\" /><br />\r\n	<br />\r\n	<br />\r\n	<span style=\"font-size: 14px;\">客户休息洽谈区</span><br />\r\n	<br />\r\n	<img data-=\"\" data-fail=\"0\" data-ratio=\"1.3333333333333333\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"960\" src=\"/uploads/170731/1-1FI110423RA.jpg\" style=\"font-size: 14px;\" /><br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<img data-=\"\" data-fail=\"0\" data-ratio=\"1.3333333333333333\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"960\" src=\"/uploads/170731/1-1FI1104304Q2.jpg\" style=\"font-size: 14px;\" /></p>\r\n<p style=\"text-align: center;\">\r\n	<br />\r\n	<br />\r\n	<span style=\"font-size: 14px;\">德洛尼橱柜乐亭旗舰店精彩图片展示与您分享！</span></p>\r\n<p style=\"text-align: center;\">\r\n	<span style=\"font-size:14px;\">德洛尼乐亭店订购热线：15613563058</span></p>\r\n', '', '', '111.194.72.45');
INSERT INTO `dede_addonarticle` VALUES ('55', '13', '<p>\r\n	<br />\r\n	<span style=\"font-size:14px;\">德洛尼橱柜在五一黄金节来临之际，推出&ldquo;爱妻有理&rdquo;活动，购爱橱柜享受爱妻四重礼！</span></p>\r\n', '', '', '111.194.72.45');
INSERT INTO `dede_addonarticle` VALUES ('56', '13', '<p>\r\n	<br />\r\n	<span style=\"font-size:14px;\">【中华橱柜网】北京德洛尼橱柜淘宝店推出两款超值团购橱柜套餐,实实在在让利给消费者。<br />\r\n	套餐一：4米吸塑橱柜套餐，只售9990元/套； 包括：4米吸塑地柜+4米石英石台面+2米吊柜+3个阻尼抽屉+1个豪华拉篮<br />\r\n	套餐二：3米吸塑橱柜套餐，只售6800元/套； 包括：3米吸塑地柜+3米石英石台面+1米吊柜+3个阻尼抽屉+1个豪华拉篮包括：3米吸塑地柜+3米石英石台面+1米吊柜+3个阻尼抽屉+1个豪华拉篮</span></p>\r\n', '', '', '111.194.72.45');
INSERT INTO `dede_addonarticle` VALUES ('57', '13', '<br />\r\n<span style=\"font-size:14px;\">【中华橱柜网】端午即将来到，德洛尼橱柜在全国各专卖店展开&ldquo;迎端午，免费送粽子；赛龙舟，飞镖中大奖&rdquo;为主题的促销活动。活动细则如下： 1、凡客人进店都可参加飞镖射大粽游戏，每人可掷三次飞镖，有不同口味及种类的粽子、射中即可拿回家。 2、意向客户皆可免费设计厨房，免费出效果图。 3、活动期间交定金者都可获得精装嘉兴礼粽一份。 4、交定金500元以上者可参与飞镖射大奖活动，有青花瓷、旅游通票、礼盒粽子、德洛尼燃气灶、烤箱、现金折扣券等奖项，每人射三次，射中什么得什么。 还有迎端午，德洛尼橱柜还推出了特价橱柜套餐，真正实惠到家，让你体验到德洛尼的真诚与实在，活动详情请咨询各地专卖店或者登录公司网站www.ykxdln.com</span>', '', '', '111.194.72.45');
INSERT INTO `dede_addonarticle` VALUES ('58', '13', '<p style=\"text-align: center;\">\r\n	<br />\r\n	<span style=\"font-size:14px;\"><img data-=\"\" data-fail=\"0\" data-ratio=\"0.75\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" src=\"/uploads/170731/1-1FI1161133B4.jpg\" /><br />\r\n	<br />\r\n	太疯狂了！一套橱柜仅需599元！就是这个店！快去抢购吧！</span><br />\r\n	<br />\r\n	<br />\r\n	<img data-=\"\" data-fail=\"0\" data-ratio=\"0.661648177496038\" data-s=\"300,640\" data-type=\"png\" data-w=\"1262\" src=\"/uploads/170731/1-1FI11611521W.jpg\" style=\"font-size: 14px;\" /><br />\r\n	<br />\r\n	<span style=\"font-size: 14px;\">哇！这么多人啊！幸好还有几个空位！</span><br />\r\n	<br />\r\n	<br />\r\n	<img data-=\"\" data-fail=\"0\" data-ratio=\"0.7185697808535179\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"867\" src=\"/uploads/170731/1-1FI1161212292.jpg\" style=\"font-size: 14px;\" /><br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<img data-=\"\" data-fail=\"0\" data-ratio=\"0.6890625\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" src=\"/uploads/170731/1-1FI1161230643.jpg\" style=\"font-size: 14px;\" /><br />\r\n	&nbsp;</p>\r\n<div style=\"text-align: center;\">\r\n	<br />\r\n	<br />\r\n	<span style=\"font-size:14px;\"><img data-=\"\" data-fail=\"0\" data-ratio=\"0.7537878787878788\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"792\" src=\"/uploads/170731/1-1FI1161254E3.jpg\" /><br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<img data-=\"\" data-fail=\"0\" data-ratio=\"0.571875\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"1280\" src=\"/uploads/170731/1-1FI1161311A4.jpg\" /><br />\r\n	<br />\r\n	<br />\r\n	<br />\r\n	<img data-=\"\" data-fail=\"0\" data-ratio=\"0.7576142131979695\" data-s=\"300,640\" data-type=\"jpeg\" data-w=\"788\" src=\"/uploads/170731/1-1FI1161401c6.jpg\" /><br />\r\n	<br />\r\n	<br />\r\n	活动现场并有好礼相送，哇！！！</span></div>\r\n<p style=\"text-align: center;\">\r\n	<span style=\"font-size:14px;\">哇塞：进店有礼！赶快去看看哦！</span></p>\r\n<p style=\"text-align: center;\">\r\n	<br />\r\n	<br />\r\n	<span style=\"font-size:14px;\">哇塞：动动手指还有礼，转发微信点赞有礼，集满18个赞，可免费到店领取陶瓷碗1套！</span></p>\r\n<p style=\"text-align: center;\">\r\n	<span style=\"font-size:14px;\">集满58个赞，可免费到店领取时尚锅1套！</span></p>\r\n<p style=\"text-align: center;\">\r\n	<br />\r\n	<br />\r\n	<span style=\"font-size:14px;\">哇塞：还有啊！凡订购产品交定金的客户，还可领取红包1个！</span></p>\r\n<p style=\"text-align: center;\">\r\n	<br />\r\n	<br />\r\n	<span style=\"font-size:14px;\">活动时间：9月5日至20日钜惠来袭！</span></p>\r\n<p style=\"text-align: center;\">\r\n	<span style=\"font-size:14px;\">活动地点：润宇装饰城C座四楼418号！</span></p>\r\n<p style=\"text-align: center;\">\r\n	<span style=\"font-size:14px;\">抢订热线：0471--2306034 &nbsp; &nbsp; &nbsp; 15661284343</span></p>\r\n<p style=\"text-align: center;\">\r\n	<br />\r\n	<br />\r\n	<span style=\"font-size:14px;\">本活动解释权归德洛尼本店所有</span></p>\r\n', '', '', '111.194.72.45');
INSERT INTO `dede_addonarticle` VALUES ('59', '12', '&nbsp; &nbsp;\r\n<div class=\"rich_media_content \" id=\"js_content\" style=\"margin: 0px; padding: 0px; overflow: hidden; color: rgb(62, 62, 62); position: relative; min-height: 350px; font-family: \'Helvetica Neue\', Helvetica, \'Hiragino Sans GB\', \'Microsoft YaHei\', Arial, sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25.6000003814697px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">\r\n	<fieldset data-id=\"34405\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; min-width: 0px; color: rgb(62, 62, 62); white-space: normal; widows: 1; font-family: 微软雅黑; line-height: 24px; border: 0px none; font-size: 14px; background-color: rgb(255, 255, 255);\">\r\n		<fieldset style=\"margin: 0.8em 0px 0.3em; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; min-width: 0px; border: none;\">\r\n			<section style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; font-size: 1em; font-weight: bold; text-align: center; text-decoration: inherit; color: rgb(255, 255, 255); border-color: rgb(195, 39, 43);\">\r\n				<section data-brushtype=\"text\" style=\"margin: 0px; padding: 0.5em; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; line-height: 1.2em; font-size: 1em; background-color: rgb(195, 39, 43);\">\r\n					<div>\r\n						在营销界有这样一个经典案例：</div>\r\n				</section>\r\n				<section data-width=\"0px\" style=\"margin: 0px auto; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; width: 0px; border-top-width: 0.6em; border-top-style: solid; border-bottom-color: rgb(195, 39, 43); border-top-color: rgb(195, 39, 43); height: 10px; border-left-width: 1em !important; border-left-style: solid !important; border-left-color: transparent !important; border-right-width: 1em !important; border-right-style: solid !important; border-right-color: transparent !important;\">\r\n					<br />\r\n					<br />\r\n					<br />\r\n					&nbsp;</section>\r\n			</section>\r\n		</fieldset>\r\n	</fieldset>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">一老太太去买菜，路过四个水果摊。四家卖的苹果相近，但老太太并没有在最先路过的第一家和第二家买苹果，而是在第三家买了一斤， 更奇怪的是在第四家又买了两斤。</span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<fieldset data-id=\"33\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; min-width: 0px; color: rgb(62, 62, 62); white-space: normal; widows: 1; font-family: 微软雅黑; line-height: 24px; border: 0px none; font-size: 14px; background-color: rgb(255, 255, 255);\">\r\n		<h2 style=\"margin: 8px 0px 0px; padding: 0px; font-weight: 400; font-size: 16px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(172, 29, 16); min-height: 32px; border-bottom-width: 2px; border-bottom-style: solid; border-color: rgb(172, 29, 16); text-align: justify;\">\r\n			<span style=\"font-size:14px;\"><span placeholder=\"1\" style=\"margin: 0px 8px 0px 0px; padding: 4px 10px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border-radius: 80% 100% 90% 20%; color: rgb(255, 255, 255); display: block; float: left; line-height: 20px; border-color: rgb(214, 87, 76); background-color: rgb(172, 29, 16);\">1</span><span style=\"font-size:16px;\"><strong data-brushtype=\"text\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border-color: rgb(172, 29, 16); color: inherit;\">摊主一</strong></span></span></h2>\r\n	</fieldset>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">老太太去买菜，路过水果摊，看到卖苹果的摊主，就问道：&ldquo;苹果怎么样啊?&rdquo;</span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">摊主回答：&ldquo;我的苹果特别好吃，又大又甜!&rdquo;。</span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">老太太摇摇头走开了<span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">（只讲产品卖点，不探求需求、都是无效介绍，做不了单）</span></span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<fieldset data-id=\"33\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; min-width: 0px; color: rgb(62, 62, 62); white-space: normal; widows: 1; font-family: 微软雅黑; line-height: 24px; border: 0px none; font-size: 14px; background-color: rgb(255, 255, 255);\">\r\n		<h2 style=\"margin: 8px 0px 0px; padding: 0px; font-weight: 400; font-size: 16px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(172, 29, 16); min-height: 32px; border-bottom-width: 2px; border-bottom-style: solid; border-color: rgb(172, 29, 16); text-align: justify;\">\r\n			<span style=\"font-size:14px;\"><span placeholder=\"1\" style=\"margin: 0px 8px 0px 0px; padding: 4px 10px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border-radius: 80% 100% 90% 20%; color: rgb(255, 255, 255); display: block; float: left; line-height: 20px; border-color: rgb(214, 87, 76); background-color: rgb(172, 29, 16);\">2</span><span style=\"font-size:16px;\"><strong data-brushtype=\"text\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border-color: rgb(172, 29, 16); color: inherit;\">摊主二</strong></span></span></h2>\r\n	</fieldset>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">老太太又到一个摊子，问:&ldquo;你的苹果什么口味的？&rdquo;</span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">摊主措手不及：&ldquo;早上刚到的货，没来得及尝尝，看这红润的表皮应该很甜&rdquo;。</span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">老太太二话没说扭头就走了。<span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">（对产品了解一定是亲自体验出的，亲自体验感受出的才是卖点。只限于培训听到的知识，应对不了客户）</span></span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<fieldset data-id=\"33\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; min-width: 0px; color: rgb(62, 62, 62); white-space: normal; widows: 1; font-family: 微软雅黑; line-height: 24px; border: 0px none; font-size: 14px; background-color: rgb(255, 255, 255);\">\r\n		<h2 style=\"margin: 8px 0px 0px; padding: 0px; font-weight: 400; font-size: 16px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(172, 29, 16); min-height: 32px; border-bottom-width: 2px; border-bottom-style: solid; border-color: rgb(172, 29, 16); text-align: justify;\">\r\n			<span style=\"font-size:14px;\"><span placeholder=\"1\" style=\"margin: 0px 8px 0px 0px; padding: 4px 10px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border-radius: 80% 100% 90% 20%; color: rgb(255, 255, 255); display: block; float: left; line-height: 20px; border-color: rgb(214, 87, 76); background-color: rgb(172, 29, 16);\">3</span><span style=\"font-size:16px;\"><strong data-brushtype=\"text\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border-color: rgb(172, 29, 16); color: inherit;\">摊主三</strong></span></span></h2>\r\n	</fieldset>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">旁边的摊主见状问道：&ldquo;老太太，您要什么苹果，我这里种类很全!&rdquo;</span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">老太太：&ldquo;我想买酸点的苹果&rdquo;。</span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">摊主：&ldquo;我这种苹果口感比较酸，请问您要多少斤?&rdquo;</span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">老太太：&ldquo;那就来一斤吧&rdquo;。<span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">(客户需求把握了，但需求背后的动机是什么？丧失进一步挖掘的机会，属于客户自主购买，自然销售不能将单值放大）</span></span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<fieldset data-id=\"33\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; min-width: 0px; color: rgb(62, 62, 62); white-space: normal; widows: 1; font-family: 微软雅黑; line-height: 24px; border: 0px none; font-size: 14px; background-color: rgb(255, 255, 255);\">\r\n		<h2 style=\"margin: 8px 0px 0px; padding: 0px; font-weight: 400; font-size: 16px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(172, 29, 16); min-height: 32px; border-bottom-width: 2px; border-bottom-style: solid; border-color: rgb(172, 29, 16); text-align: justify;\">\r\n			<span style=\"font-size:14px;\"><span placeholder=\"1\" style=\"margin: 0px 8px 0px 0px; padding: 4px 10px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border-radius: 80% 100% 90% 20%; color: rgb(255, 255, 255); display: block; float: left; line-height: 20px; border-color: rgb(214, 87, 76); background-color: rgb(172, 29, 16);\">4</span><span style=\"font-size:16px;\"><strong data-brushtype=\"text\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border-color: rgb(172, 29, 16); color: inherit;\">摊主四</strong></span></span></h2>\r\n	</fieldset>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">这时她又看到一个摊主的苹果便去询问：&ldquo;你的苹果怎么样啊?&rdquo;</span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">摊主：&ldquo;我的苹果很不错的，请问您想要什么样的苹果呢?&rdquo;<span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">（探求需求）</span></span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">老太太：&ldquo;我想要酸一些的&rdquo;</span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">摊主:&ldquo;一般人买苹果都是要大的甜的，您为什么要酸苹果呢?&rdquo;<span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">（挖掘更深的需求）</span></span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">老太太：&ldquo;儿媳妇儿怀孕了，想吃点酸的苹果&rdquo;</span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">摊主：&ldquo;老太太您对儿媳妇儿真是体贴啊，将来您媳妇儿一定能给您生一个大胖孙子。<span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">（适度恭维，拉近距离）</span>几个月以前，附近也有两家要生孩子的，她们就来我这里买苹果，<span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">（讲案例，第三方佐证）</span>您猜怎么着?这两家都生了个儿子，<span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">(构建情景，引发憧憬）</span><span class=\"Apple-converted-space\">&nbsp;</span>你想要多少? （<span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">封闭提问，默认成交，适时逼单 ，该出手时就出手）</span></span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">老太太：&ldquo;我再来两斤吧。&rdquo;</span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">老太太被摊主说得高兴了<span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">(客户的感觉有了，一切都有了）</span>。摊主又对老太太介绍其他水果。</span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">摊主：&ldquo;橘子也适合孕妇吃，酸甜还有多种维生素，特别有营养<span class=\"Apple-converted-space\">&nbsp;</span><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">(连单，最大化购买，不给对手机会）</span>，您要是给媳妇儿来点橘子，她肯定开心!<span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">（愿景引发）</span>&rdquo;</span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">老太太：&ldquo;是嘛!好那就来三斤橘子吧。&rdquo;</span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">摊主：&ldquo;您人可真好，媳妇儿要是摊上了您这样的婆婆，实在太有福气了!</span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">&rdquo;<span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">(适度准确拍马屁，不要拍到马蹄子上）</span></span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">摊主称赞着老太太，又说他的水果每天都是几点进货，天天卖光，保证新鲜<span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">(将单砸实，让客户踏实）</span>，要是吃好了，让老太太再过来<span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">(建立客户黏性）。</span></span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">老太太被摊主夸得开心，说&ldquo;要是吃的好，让朋友也来买&rdquo;提着水果，满意的回家了。</span></span><br />\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; background-color: rgb(255, 255, 255); word-wrap: break-word !important; text-align: center;\">\r\n		<img data-=\"\" data-fail=\"0\" data-ratio=\"1.0197841726618706\" data-s=\"300,640\" data-type=\"png\" data-w=\"\" src=\"/uploads/170731/1-1FI11G31a18.jpg\" style=\"font-size: 14px; text-align: center; margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; overflow-wrap: break-word !important; visibility: visible !important;\" /><br />\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; text-align: center; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(0, 112, 192); word-wrap: break-word !important;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">那么，销售卖什么？</strong></span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; text-align: center; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(217, 33, 66); word-wrap: break-word !important;\">生客卖的是礼貌</span></strong></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; text-align: center; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(217, 33, 66); word-wrap: break-word !important;\">熟客卖的是热情</span></strong></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; text-align: center; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; color: rgb(217, 33, 66); word-wrap: break-word !important;\">急客卖的是效率</span></strong></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; text-align: center; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(217, 33, 66);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">慢客卖的是耐心</span></strong></span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; text-align: center; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(217, 33, 66);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">有钱卖的是尊贵</span></strong></span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; text-align: center; background-color: rgb(255, 255, 255);\">\r\n		<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(217, 33, 66);\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">没钱卖的是实惠</span></strong></span></span></p>\r\n	<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(62, 62, 62); widows: 1; font-family: 微软雅黑; font-size: 13.3333px; line-height: 2em; text-align: center; background-col