INSERT INTO `dede_addonarticle` VALUES ('60', '13', '<div id=\"img-content\" style=\"margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: \'Helvetica Neue\', Helvetica, \'Hiragino Sans GB\', \'Microsoft YaHei\', Arial, sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25.6000003814697px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">\r\n	<div class=\"rich_media_meta_list\" id=\"meta_content\" style=\"margin: 0px 0px 18px; padding: 0px; line-height: 20px; font-size: 0px;\">\r\n		&nbsp;</div>\r\n	<div class=\"rich_media_content \" id=\"js_content\" style=\"margin: 0px; padding: 0px; overflow: hidden; color: rgb(62, 62, 62); position: relative; min-height: 350px;\">\r\n		<section data-id=\"85921\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(62, 62, 62); font-family: 微软雅黑; line-height: 25.6000003814697px; white-space: normal; border: 0px none; background-color: rgb(255, 255, 255);\">\r\n			<section style=\"margin: 5px auto; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">\r\n				<section style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; height: 3em;\">\r\n					<section style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; width: 6em; float: right; border-top-width: 0.4em; border-top-style: solid; border-color: rgb(172, 29, 16);\">\r\n						&nbsp;</section>\r\n				</section>\r\n				<section style=\"margin: -2.8em 0em -0.2em; padding: 0.8em; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border-width: 1px 0.4em; border-style: solid; border-color: rgb(172, 29, 16); border-radius: 0.3em; vertical-align: top;\">\r\n					<span style=\"font-size:14px;\">在电商的一波又一波的猛烈冲击下，实体店的经营愈发困难，除了饮鸩止渴的促销，好像没有别的办法。其实不然，线下看似红海，但用心照样可以做得很好。做好以下10个方面的工作，让自己的店贴地气，也聚来人气。</span></section>\r\n				<section style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; width: 6em; float: left; border-bottom-width: 0.4em; border-bottom-style: solid; border-color: rgb(172, 29, 16);\">\r\n					&nbsp;</section>\r\n				<section style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; width: 6em; float: right; border-bottom-width: 0.4em; border-bottom-style: solid; border-color: rgb(172, 29, 16);\">\r\n					&nbsp;</section>\r\n			</section>\r\n			<section style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; width: 0px; height: 0px; clear: both;\">\r\n				&nbsp;</section>\r\n		</section>\r\n		<section data-id=\"86014\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(62, 62, 62); font-family: 微软雅黑; line-height: 25.6000003814697px; white-space: normal; border: 0px none; background-color: rgb(255, 255, 255);\">\r\n			<section style=\"margin: 0px 0px -3.2em; padding: 0px 0px 0px 5px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; line-height: 2.5em;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(136, 191, 177); box-sizing: border-box !important; word-wrap: break-word !important;\"><em data-original-title=\"\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-style: italic;\" title=\"\">1</em></span></span></p>\r\n			</section>\r\n			<section style=\"margin: 0px; padding: 2px 10px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border-radius: 1em; display: inline-block; color: rgb(255, 255, 255); background-color: rgba(248, 122, 122, 0.65098);\">\r\n				<span style=\"font-size:16px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span data-brushtype=\"text\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">好的选址是成功的一半</span></strong></span></section>\r\n			<section style=\"margin: 14px 0px 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; line-height: inherit;\">伦敦天桥上，一位摆摊卖时尚杂志的八旬老头，他时常忘记好些事，包括他的妻子。一个头发花白，却打扮时髦的老太太，因为腿脚不好，拄着拐杖。她艰难的爬上天桥，问老头：&ldquo;来了吗？&rdquo;老头总是摇摇头。就这样日复一日，老太太每天都来，每天都问老头，来了吗？老头总是摇摇头。直到有一天，老太太没来，老头望着夜幕，泪流满面的说：&ldquo;它来了，我们的爱情。&rdquo;</span></span></p>\r\n			</section>\r\n			<section style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; width: 0px; height: 0px; clear: both;\">\r\n				&nbsp;</section>\r\n		</section>\r\n		<section data-id=\"86014\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(62, 62, 62); font-family: 微软雅黑; line-height: 25.6000003814697px; white-space: normal; border: 0px none; background-color: rgb(255, 255, 255);\">\r\n			<section style=\"margin: 0px 0px -3.2em; padding: 0px 0px 0px 5px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; line-height: 2.5em;\">\r\n					&nbsp;</p>\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; line-height: 2.5em;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(136, 191, 177); box-sizing: border-box !important; word-wrap: break-word !important;\"><em data-original-title=\"\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-style: italic;\" title=\"\">2</em></span></span></p>\r\n			</section>\r\n			<section style=\"margin: 0px; padding: 2px 10px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border-radius: 1em; display: inline-block; color: rgb(255, 255, 255); background-color: rgba(248, 122, 122, 0.65098);\">\r\n				<span style=\"font-size:16px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span data-brushtype=\"text\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">门店的休息区有多大</span></strong></span></section>\r\n			<section style=\"margin: 14px 0px 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; line-height: inherit;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; line-height: 1.6; white-space: pre-wrap;\">有多大往往和进店率成正比!相信很多门店开业前都有店铺平面图、卖场</span><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; line-height: 28px; white-space: pre-wrap;\">设计</span><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; line-height: 1.6; white-space: pre-wrap;\">等，前期很多老板可能都会考虑坪效最大化，选择加大货架，从而加大陈列量。从某种角度来说，站在顾客立场，一个进去感觉很拥挤，购物空间不是很舒畅的门店，你觉得他会进去吗?</span></span></span></p>\r\n			</section>\r\n			<section style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; width: 0px; height: 0px; clear: both;\">\r\n				&nbsp;</section>\r\n		</section>\r\n		<section data-id=\"86014\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(62, 62, 62); font-family: 微软雅黑; line-height: 25.6000003814697px; white-space: normal; border: 0px none; background-color: rgb(255, 255, 255);\">\r\n			<section style=\"margin: 0px 0px -3.2em; padding: 0px 0px 0px 5px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; line-height: 2.5em;\">\r\n					&nbsp;</p>\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; line-height: 2.5em;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(136, 191, 177); box-sizing: border-box !important; word-wrap: break-word !important;\"><em data-original-title=\"\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-style: italic;\" title=\"\">3</em></span></span></p>\r\n			</section>\r\n			<section style=\"margin: 0px; padding: 2px 10px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border-radius: 1em; display: inline-block; color: rgb(255, 255, 255); background-color: rgba(248, 122, 122, 0.65098);\">\r\n				<span style=\"font-size:16px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span data-brushtype=\"text\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">做好橱窗规划</span></strong></span></section>\r\n			<section style=\"margin: 14px 0px 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; line-height: 1.6;\">相信这点大家都清楚，橱窗是门店的脸面，这个人怎样，先看脸，这个店怎样，先看橱窗，怎么样是一个好的橱窗呢?</span></span></p>\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(255, 255, 255); line-height: 1.75em; text-align: justify;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(0, 0, 0); line-height: 1.6;\">首先，要设定橱窗的主题(你想告诉顾客什么?);</span></span></p>\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(255, 255, 255); line-height: 1.75em; text-align: justify;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(0, 0, 0); line-height: 1.6;\">其次，针对主题选定好服饰和道具(通过什么展示);</span></span></p>\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(255, 255, 255); line-height: 1.75em; text-align: justify;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(0, 0, 0); line-height: 1.6;\">第三，做好橱窗的每一个细节(细节决定成败);</span></span></p>\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(255, 255, 255); line-height: 1.75em; text-align: justify;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(0, 0, 0); line-height: 1.6;\">第四，调整好店内人员站位(结合主题，思考店员怎么站位好);</span></span></p>\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(255, 255, 255); line-height: 1.75em; text-align: justify;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(0, 0, 0); line-height: 1.6;\">第五，调整好灯光;</span></span></p>\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(255, 255, 255); line-height: 1.75em; text-align: justify;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(0, 0, 0); line-height: 1.6;\">第六，确定你的橱窗空间展示是否有立体、有层次、有主题、有故事，可以引人入胜。当然如果条件允许的话，你也可以考虑动态橱窗或真人秀橱窗。</span></span></p>\r\n			</section>\r\n			<section style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; width: 0px; height: 0px; clear: both;\">\r\n				&nbsp;</section>\r\n		</section>\r\n		<section data-id=\"86014\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(62, 62, 62); font-family: 微软雅黑; line-height: 25.6000003814697px; white-space: normal; border: 0px none; background-color: rgb(255, 255, 255);\">\r\n			<section style=\"margin: 0px 0px -3.2em; padding: 0px 0px 0px 5px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; line-height: 2.5em;\">\r\n					&nbsp;</p>\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; line-height: 2.5em;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(136, 191, 177); box-sizing: border-box !important; word-wrap: break-word !important;\"><em data-original-title=\"\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-style: italic;\" title=\"\">4</em></span></span></p>\r\n			</section>\r\n			<section style=\"margin: 0px; padding: 2px 10px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border-radius: 1em; display: inline-block; color: rgb(255, 255, 255); background-color: rgba(248, 122, 122, 0.65098);\">\r\n				<span style=\"font-size:16px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span data-brushtype=\"text\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">灯光布置的合理性</span></strong></span></section>\r\n			<section style=\"margin: 14px 0px 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; line-height: 1.6;\">人的本能是趋光性，五大感官首选视觉感官，而光在此过程中起主要作用，灯光应该打在哪里，什么时候开什么灯，应该有个流程表。</span></span></p>\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; color: rgb(255, 255, 255); line-height: 1.75em;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(0, 0, 0); line-height: 1.6;\">记得之前有个问题一直在纠结，客户因为晚上没顾客，所以没开LOGO灯，可能考虑到费用管理，试问，你招牌灯都不开的店，顾客会进来吗?相比之下，有些店铺关店后LOGO持续开着，老板说是打广告，这样的老板有魄力。</span></span></p>\r\n			</section>\r\n			<section style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; width: 0px; height: 0px; clear: both;\">\r\n				&nbsp;</section>\r\n		</section>\r\n		<section data-id=\"86014\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(62, 62, 62); font-family: 微软雅黑; line-height: 25.6000003814697px; white-space: normal; border: 0px none; background-color: rgb(255, 255, 255);\">\r\n			<section style=\"margin: 0px 0px -3.2em; padding: 0px 0px 0px 5px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; line-height: 2.5em;\">\r\n					&nbsp;</p>\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; line-height: 2.5em;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(136, 191, 177); box-sizing: border-box !important; word-wrap: break-word !important;\"><em data-original-title=\"\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-style: italic;\" title=\"\">5</em></span></span></p>\r\n			</section>\r\n			<section style=\"margin: 0px; padding: 2px 10px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border-radius: 1em; display: inline-block; color: rgb(255, 255, 255); background-color: rgba(248, 122, 122, 0.65098);\">\r\n				<span style=\"font-size:16px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span data-brushtype=\"text\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">顾客期望的环境</span></strong></span></section>\r\n			<section style=\"margin: 14px 0px 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; line-height: 25.6000003814697px; white-space: pre-wrap;\">顾客期望得到的是一个自然、温馨、舒适的购物环境，其实也就是另一个&ldquo;家&rdquo;。围绕三个环境因素，结合本身品牌定位及消费群体，塑造好的购物环境和体验是重要因素。</span></span></p>\r\n			</section>\r\n			<section style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; width: 0px; height: 0px; clear: both;\">\r\n				&nbsp;</section>\r\n		</section>\r\n		<section data-id=\"86014\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(62, 62, 62); font-family: 微软雅黑; line-height: 25.6000003814697px; white-space: normal; border: 0px none; background-color: rgb(255, 255, 255);\">\r\n			<section style=\"margin: 0px 0px -3.2em; padding: 0px 0px 0px 5px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; line-height: 2.5em;\">\r\n					&nbsp;</p>\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; line-height: 2.5em;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(136, 191, 177); box-sizing: border-box !important; word-wrap: break-word !important;\"><em data-original-title=\"\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-style: italic;\" title=\"\">6</em></span></span></p>\r\n			</section>\r\n			<section style=\"margin: 0px; padding: 2px 10px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border-radius: 1em; display: inline-block; color: rgb(255, 255, 255); background-color: rgba(248, 122, 122, 0.65098);\">\r\n				<span style=\"font-size:16px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span data-brushtype=\"text\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">听觉触动影响</span></strong></span></section>\r\n			<section style=\"margin: 14px 0px 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; line-height: inherit; white-space: pre-wrap;\">除了视觉，听觉触动也是影响因素之一。什么时段放什么音乐，节庆假日放什么音乐，这也是需要大家思考的问题，杜绝一天到晚循环播放几首曲子，音乐应该分时段，有主题，有吸引力。</span></span></p>\r\n			</section>\r\n			<section style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; width: 0px; height: 0px; clear: both;\">\r\n				&nbsp;</section>\r\n		</section>\r\n		<section data-id=\"86014\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(62, 62, 62); font-family: 微软雅黑; line-height: 25.6000003814697px; white-space: normal; border: 0px none; background-color: rgb(255, 255, 255);\">\r\n			<section style=\"margin: 0px 0px -3.2em; padding: 0px 0px 0px 5px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; line-height: 2.5em;\">\r\n					&nbsp;</p>\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; line-height: 2.5em;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(136, 191, 177); box-sizing: border-box !important; word-wrap: break-word !important;\"><em data-original-title=\"\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-style: italic;\" title=\"\">7</em></span></span></p>\r\n			</section>\r\n			<section style=\"margin: 0px; padding: 2px 10px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border-radius: 1em; display: inline-block; color: rgb(255, 255, 255); background-color: rgba(248, 122, 122, 0.65098);\">\r\n				<span style=\"font-size:16px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span data-brushtype=\"text\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">塑造旺场的员工站位</span></strong></span></section>\r\n			<section style=\"margin: 14px 0px 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; line-height: 1.6;\">中国人有个特点叫聚众消费，旺场的时候，顾客会因好奇心往店里进去，淡场时呢?所以你一定要塑造旺场氛围，也可以做模拟演练等，塑造旺场氛围。</span></span></p>\r\n			</section>\r\n			<section style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; width: 0px; height: 0px; clear: both;\">\r\n				&nbsp;</section>\r\n		</section>\r\n		<section data-id=\"86014\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(62, 62, 62); font-family: 微软雅黑; line-height: 25.6000003814697px; white-space: normal; border: 0px none; background-color: rgb(255, 255, 255);\">\r\n			<section style=\"margin: 0px 0px -3.2em; padding: 0px 0px 0px 5px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; line-height: 2.5em;\">\r\n					&nbsp;</p>\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; line-height: 2.5em;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(136, 191, 177); box-sizing: border-box !important; word-wrap: break-word !important;\"><em data-original-title=\"\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-style: italic;\" title=\"\">8</em></span></span></p>\r\n			</section>\r\n			<section style=\"margin: 0px; padding: 2px 10px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border-radius: 1em; display: inline-block; color: rgb(255, 255, 255); background-color: rgba(248, 122, 122, 0.65098);\">\r\n				<span style=\"font-size:16px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span data-brushtype=\"text\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">做好迎宾送宾</span></strong></span></section>\r\n			<section style=\"margin: 14px 0px 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; line-height: inherit; white-space: pre-wrap;\">很多门店都有迎宾，有的还是标准化的训练，非常到位，但是往往忽视了送宾这环节，古语&ldquo;送客送到三里外&rdquo;，只要你在收银环节、送宾环节重视，相信销量会有提升的。</span></span></p>\r\n			</section>\r\n			<section style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; width: 0px; height: 0px; clear: both;\">\r\n				&nbsp;</section>\r\n		</section>\r\n		<section data-id=\"86014\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: rgb(62, 62, 62); font-family: 微软雅黑; line-height: 25.6000003814697px; white-space: normal; border: 0px none; background-color: rgb(255, 255, 255);\">\r\n			<section style=\"margin: 0px 0px -3.2em; padding: 0px 0px 0px 5px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; line-height: 2.5em;\">\r\n					&nbsp;</p>\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; line-height: 2.5em;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; color: rgb(136, 191, 177); box-sizing: border-box !important; word-wrap: break-word !important;\"><em data-original-title=\"\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-style: italic;\" title=\"\">9</em></span></span></p>\r\n			</section>\r\n			<section style=\"margin: 0px; padding: 2px 10px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border-radius: 1em; display: inline-block; color: rgb(255, 255, 255); background-color: rgba(248, 122, 122, 0.65098);\">\r\n				<span style=\"font-size:16px;\"><strong style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span data-brushtype=\"text\" style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">提升店铺员工形象</span></strong></span></section>\r\n			<section style=\"margin: 14px 0px 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;\">\r\n				<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em; text-align: justify;\">\r\n					<span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; line-height: 1.6;\">提升店铺员工形象也是品牌形象重要的一环节。</span><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; line-height: 1.6;\">员工代表店铺，代表品牌，其言行举止，销售接待相信你都会经过一定的培训，但是，在这里，需要的是固化。除了店铺名片，员工应该也给予</span><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; line-height: 1.75em;\">设计</span><span style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; line-height: 1.6;\">名片，一来宣传员工形象;二来给予员工自信，在有了自信之后，相信员工的能力定会提升，服务也势必提升，届时，顾客还不进店吗?</span></span></p>\r\n			</section>\r\n		</section>\r\n		<p style=\"margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; clear: both; min-height: 1em;\">\r\n			&nbsp;</p>\r\n	</div>\r\n</div>\r\n<div class=\"rich_media_tool\" id=\"js_toobar3\" style=\"margin: 0px; padding: 15px 0px 0px; font-size: 14px; overflow: hidden; line-height: 32px; color: rgb(0, 0, 0); font-family: \'Helvetica Neue\', Helvetica, \'Hiragino Sans GB\', \'Microsoft YaHei\', Arial, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">\r\n	&nbsp;</div>\r\n', '', '', '111.194.72.45');
INSERT INTO `dede_addonarticle` VALUES ('295', '52', '21世纪，随着社会的稳定发展。百姓安居乐业，生活水平日渐小康，大大提升了生活质量。<br />\r\n人们开始住上新房，用心地打造出一个个属于自己温馨的避风港。而家，最不可缺少的就是厨房。<br />\r\n如何打造一个安全、实用且绿色环保的的厨房，橱柜选择很重要。', '', '', '114.241.106.181');
INSERT INTO `dede_addonarticle` VALUES ('297', '21', '德洛尼橱柜陕西咸阳专卖店', '', '', '223.72.91.247');
