INSERT INTO `dede_addonimages` VALUES ('45', '19', '2', '800', '{dede:pagestyle maxwidth=\'800\' pagepicnum=\'12\' ddmaxwidth=\'200\' row=\'3\' col=\'4\' value=\'2\'/}\r\n{dede:img ddimg=\'/uploads/allimg/170724/1-1FH4110948.png\' text=\'1\' width=\'1920\' height=\'450\'} /uploads/allimg/170724/1-1FH4110948.png {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170724/1-1FH4111034.png\' text=\'2\' width=\'1920\' height=\'450\'} /uploads/allimg/170724/1-1FH4111034.png {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170724/1-1FH4111039.png\' text=\'3\' width=\'1920\' height=\'450\'} /uploads/allimg/170724/1-1FH4111039.png {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170724/1-1FH4111045.png\' text=\'4\' width=\'1920\' height=\'450\'} /uploads/allimg/170724/1-1FH4111045.png {/dede:img}\r\n', '3', '4', '1', '200', '12', '', '0.0.0.0', '', '<p>\r\n	位于闵行核心区，总用地面积逾50万m2，栋距超百米， 240m2以上精装大平层设计，270?宽阔观景视野，近2万m2中心水景湖泊。坐拥7大商业广场、7处书香圣地、 网球场及高尔夫球场等、联合上海星河湾高品位商业配套资源，为尊贵业主创造品质生活。</p>\r\n');
INSERT INTO `dede_addonimages` VALUES ('40', '19', '2', '800', '{dede:pagestyle maxwidth=\'800\' pagepicnum=\'12\' ddmaxwidth=\'200\' row=\'3\' col=\'4\' value=\'2\'/}\r\n{dede:img ddimg=\'/uploads/allimg/170722/1-1FH2145333.png\' text=\'1\' width=\'760\' height=\'350\'} /uploads/allimg/170722/1-1FH2145333.png {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170722/1-1FH2145343.png\' text=\'2\' width=\'760\' height=\'350\'} /uploads/allimg/170722/1-1FH2145343.png {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170722/1-1FH2145401.png\' text=\'3\' width=\'760\' height=\'350\'} /uploads/allimg/170722/1-1FH2145401.png {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170722/1-1FH2145409.png\' text=\'4\' width=\'760\' height=\'350\'} /uploads/allimg/170722/1-1FH2145409.png {/dede:img}\r\n', '3', '4', '1', '200', '12', '', '0.0.0.0', '', '<p>\r\n	讲究简洁实用：因为风格相对简洁，细节处理便显得尤为重要。美式家具一般采用胡桃木和枫木， 为了突出木质本身的特点，它纹理本身成为一种装饰。可以在不同角度下产生不同的光感。 这使美式家具比金光闪耀的欧式家具更耐看。美式家具的另一个重要特点就是他的实用性比较强， 如有专门用于缝纫的桌子，可以加长或折成几张小桌子的大餐台等。另外，美式家具中的五金饰比较考究， 小小一个拉手便有上百种造型。正是这些小玩意使得美式家具更具风格。</p>\r\n');
