INSERT INTO `dede_addonimages` VALUES ('158', '29', '2', '800', '{dede:pagestyle maxwidth=\'800\' pagepicnum=\'12\' ddmaxwidth=\'200\' row=\'3\' col=\'4\' value=\'2\'/}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG43H0.jpg\' text=\'\' width=\'800\' height=\'600\'} /uploads/allimg/170817/1-1FQG43H0.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG43H0-50.jpg\' text=\'\' width=\'800\' height=\'600\'} /uploads/allimg/170817/1-1FQG43H0-50.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG43H0-51.jpg\' text=\'\' width=\'800\' height=\'1067\'} /uploads/allimg/170817/1-1FQG43H0-51.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG43H0-52.jpg\' text=\'\' width=\'800\' height=\'1067\'} /uploads/allimg/170817/1-1FQG43H0-52.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG43H1.jpg\' text=\'\' width=\'800\' height=\'1067\'} /uploads/allimg/170817/1-1FQG43H1.jpg {/dede:img}\r\n', '3', '4', '1', '200', '12', '', '114.241.106.181', '', '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft Yahei&quot;, 微软雅黑, arial, 宋体, sans-serif; font-size: 16px; text-align: justify;\">造型美：因实木有很好的加工性和可塑性。所以，实木产品可以做出其它材料所做不出来的复杂造型，如雕花、多圆边、棱角的挺拔性等。色彩美：因实木来自天然，而且实木本身就有着天然的紋里与毛孔。所以，实木门板经过油漆工艺以后，可以做出很美的紋路和丰富的、充满层次的颜色，而其它材料做出的门板产品没有真正的自然紋路且颜色很单调，也不丰富和没有层次感。多元性：因为实木产品的造型变化空间与颜色变化空间很大，所以实木产品通过造型与颜色搭配，可以做出千变万化的产品效果，这种效果也是消费者所说的味道或生活方式。</span>');
