INSERT INTO `dede_addonimages` VALUES ('170', '24', '2', '800', '{dede:pagestyle maxwidth=\'800\' pagepicnum=\'12\' ddmaxwidth=\'200\' row=\'3\' col=\'4\' value=\'2\'/}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG50557.jpg\' text=\'\' width=\'800\' height=\'533\'} /uploads/allimg/170817/1-1FQG50557.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG50557-50.jpg\' text=\'\' width=\'800\' height=\'533\'} /uploads/allimg/170817/1-1FQG50557-50.jpg {/dede:img}\r\n', '3', '4', '1', '200', '12', '', '114.241.106.181', '', '<span style=\"color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; text-indent: 28px;\">又称墙裙，壁板。护墙装饰板是近年来发展起来的新型装饰墙体的材料，一般采用木材等为基材。护墙装饰板具有质轻，防火、防蛀，施工简便，造价低廉，使用安全，装饰效果明显，维护保养方便等优点。它既可代替木墙裙，又可代替壁纸、墙砖等墙体材料，因此使用十分广泛。</span>');
