INSERT INTO `dede_addonimages` VALUES ('183', '19', '2', '800', '{dede:pagestyle maxwidth=\'800\' pagepicnum=\'12\' ddmaxwidth=\'200\' row=\'3\' col=\'4\' value=\'2\'/}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG60040.jpg\' text=\'\' width=\'800\' height=\'500\'} /uploads/allimg/170817/1-1FQG60040.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG60040-50.jpg\' text=\'\' width=\'800\' height=\'534\'} /uploads/allimg/170817/1-1FQG60040-50.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG60040-51.jpg\' text=\'\' width=\'800\' height=\'500\'} /uploads/allimg/170817/1-1FQG60040-51.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG60041.jpg\' text=\'\' width=\'800\' height=\'500\'} /uploads/allimg/170817/1-1FQG60041.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG60041-50.jpg\' text=\'\' width=\'800\' height=\'500\'} /uploads/allimg/170817/1-1FQG60041-50.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG60042.bmp\' text=\'\' width=\'800\' height=\'534\'} /uploads/allimg/170817/1-1FQG60042.bmp {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG60042.jpg\' text=\'\' width=\'800\' height=\'470\'} /uploads/allimg/170817/1-1FQG60042.jpg {/dede:img}\r\n', '3', '4', '1', '200', '12', '', '114.241.106.181', '', '<span style=\"color: rgb(85, 85, 85); font-family: 微软雅黑; font-size: 14px; line-height: 30px;\">地中海风格在造型方面，一般选择流畅的线条，圆弧形就是很好的选择，他可以放在我们家居的空间的每一个角落，一个圆弧形的拱门，一个流线型的门窗，都是地中海家装中的重要元素。并且地中海风格要求自然清新的效果，墙壁可以不需要精心的粉刷，让他自然的呈现一些凹凸和粗糙之感。电视背景墙无需精心装饰，一片马赛克墙砖的镶嵌就是很好的背景。</span>');
INSERT INTO `dede_addonimages` VALUES ('184', '19', '2', '800', '{dede:pagestyle maxwidth=\'800\' pagepicnum=\'12\' ddmaxwidth=\'200\' row=\'3\' col=\'4\' value=\'2\'/}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG61345.jpg\' text=\'\' width=\'800\' height=\'500\'} /uploads/allimg/170817/1-1FQG61345.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG61348.jpg\' text=\'\' width=\'800\' height=\'500\'} /uploads/allimg/170817/1-1FQG61348.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG61354.jpg\' text=\'\' width=\'800\' height=\'500\'} /uploads/allimg/170817/1-1FQG61354.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG61357.jpg\' text=\'\' width=\'800\' height=\'534\'} /uploads/allimg/170817/1-1FQG61357.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG61358.jpg\' text=\'\' width=\'800\' height=\'534\'} /uploads/allimg/170817/1-1FQG61358.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG61401.jpg\' text=\'\' width=\'800\' height=\'500\'} /uploads/allimg/170817/1-1FQG61401.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG61402.jpg\' text=\'\' width=\'800\' height=\'600\'} /uploads/allimg/170817/1-1FQG61402.jpg {/dede:img}\r\n', '3', '4', '1', '200', '12', '', '114.241.106.181', '', '<span style=\"color: rgb(85, 85, 85); font-family: 微软雅黑; font-size: 14px; line-height: 30px;\">讲究简洁实用：因为风格相对简洁，细节处理便显得尤为重要。美式家具一般采用胡桃木和枫木，为了突出木质本身的特点，它纹理本身成为一种装饰。可以在不同角度下产生不同的光感。这使美式家具比金光闪耀的欧式家具更耐看。美式家具的另一个重要特点就是他的实用性比较强，如有专门用于缝纫的桌子，可以加长或折成几张小桌子的大餐台等。另外，美式家具中的五金饰比较考究，小小一个拉手便有上百种造型。正是这些小玩意使得美式家具更具风格。</span>');
INSERT INTO `dede_addonimages` VALUES ('185', '19', '2', '800', '{dede:pagestyle maxwidth=\'800\' pagepicnum=\'12\' ddmaxwidth=\'200\' row=\'3\' col=\'4\' value=\'2\'/}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG61932.jpg\' text=\'\' width=\'800\' height=\'470\'} /uploads/allimg/170817/1-1FQG61932.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG61932-50.jpg\' text=\'\' width=\'800\' height=\'600\'} /uploads/allimg/170817/1-1FQG61932-50.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG61933.jpg\' text=\'\' width=\'800\' height=\'600\'} /uploads/allimg/170817/1-1FQG61933.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG61933-50.jpg\' text=\'\' width=\'800\' height=\'500\'} /uploads/allimg/170817/1-1FQG61933-50.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG61934.jpg\' text=\'\' width=\'800\' height=\'600\'} /uploads/allimg/170817/1-1FQG61934.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG61935.jpg\' text=\'\' width=\'800\' height=\'534\'} /uploads/allimg/170817/1-1FQG61935.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG61935-50.jpg\' text=\'\' width=\'800\' height=\'533\'} /uploads/allimg/170817/1-1FQG61935-50.jpg {/dede:img}\r\n', '3', '4', '1', '200', '12', '', '114.241.106.181', '', '<span style=\"color: rgb(85, 85, 85); font-family: 微软雅黑; font-size: 14px; line-height: 30px;\">崇尚古典：美式家具中常见的是新古典风格的家具。这种风格的家具，设计的重点是强调优雅的雕刻和舒适的设计。在保留了古典家具的色泽和质感的同时，又注意适应现代生活空间。在这些家具上，我们可以看到华丽的枫木滚边，枫木或胡桃木的镶嵌线，扭扣般的手把以及模仿动物形状的家具脚腿造型等。</span>');
INSERT INTO `dede_addonimages` VALUES ('186', '19', '2', '800', '{dede:pagestyle maxwidth=\'800\' pagepicnum=\'12\' ddmaxwidth=\'200\' row=\'3\' col=\'4\' value=\'2\'/}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG62547.jpg\' text=\'\' width=\'800\' height=\'618\'} /uploads/allimg/170817/1-1FQG62547.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG62547-50.jpg\' text=\'\' width=\'800\' height=\'500\'} /uploads/allimg/170817/1-1FQG62547-50.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG62548.jpg\' text=\'\' width=\'800\' height=\'534\'} /uploads/allimg/170817/1-1FQG62548.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG62548-50.jpg\' text=\'\' width=\'800\' height=\'500\'} /uploads/allimg/170817/1-1FQG62548-50.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG62548-51.jpg\' text=\'\' width=\'800\' height=\'470\'} /uploads/allimg/170817/1-1FQG62548-51.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG62548-52.jpg\' text=\'\' width=\'800\' height=\'500\'} /uploads/allimg/170817/1-1FQG62548-52.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG62548-53.jpg\' text=\'\' width=\'800\' height=\'470\'} /uploads/allimg/170817/1-1FQG62548-53.jpg {/dede:img}\r\n', '3', '4', '1', '200', '12', '', '114.241.106.181', '', '<span style=\"color: rgb(85, 85, 85); font-family: 微软雅黑; font-size: 14px; line-height: 30px;\">欧式风格家居装修装饰装潢设计理念独特，欧式风格线角变化丰富，家具及灯饰都略显欧式特色并有一定的文化氛围。现代欧式的居室有的不只是豪华大气，更多的是惬意和浪漫。通过完美的曲线，精益求精的细节处理，带给家人不尽的舒服触感，实际上和谐是欧式风格的最高境界。</span>');
INSERT INTO `dede_addonimages` VALUES ('187', '20', '2', '800', '{dede:pagestyle maxwidth=\'800\' pagepicnum=\'12\' ddmaxwidth=\'200\' row=\'3\' col=\'4\' value=\'2\'/}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG64444.jpg\' text=\'\' width=\'800\' height=\'532\'} /uploads/allimg/170817/1-1FQG64444.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG64444-50.jpg\' text=\'\' width=\'800\' height=\'532\'} /uploads/allimg/170817/1-1FQG64444-50.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG64444-51.jpg\' text=\'\' width=\'800\' height=\'529\'} /uploads/allimg/170817/1-1FQG64444-51.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG64444-52.jpg\' text=\'\' width=\'800\' height=\'583\'} /uploads/allimg/170817/1-1FQG64444-52.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG64445.jpg\' text=\'\' width=\'800\' height=\'600\'} /uploads/allimg/170817/1-1FQG64445.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG64445-50.jpg\' text=\'\' width=\'800\' height=\'600\'} /uploads/allimg/170817/1-1FQG64445-50.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQG64445-51.jpg\' text=\'\' width=\'800\' height=\'591\'} /uploads/allimg/170817/1-1FQG64445-51.jpg {/dede:img}\r\n', '3', '4', '1', '200', '12', '', '114.241.106.181', '', '<span style=\"color: rgb(85, 85, 85); font-family: 微软雅黑; font-size: 14px; line-height: 30px;\">电脑桌的颜色也要考虑与环境相宜，可以选用比较高贵典雅的色调以显出你的气质和地位，比较常见的有黑白两色。在自己的家里，最主要的是要突出自己的个性，可以按自己的喜好随意挑选，任何少见或是独特的颜色都能从一定程度上反映一个人的性格和个人魅力。</span>');
INSERT INTO `dede_addonimages` VALUES ('188', '20', '2', '800', '{dede:pagestyle maxwidth=\'800\' pagepicnum=\'12\' ddmaxwidth=\'200\' row=\'3\' col=\'4\' value=\'2\'/}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQGA116.jpg\' text=\'\' width=\'800\' height=\'600\'} /uploads/allimg/170817/1-1FQGA116.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQGA116-50.jpg\' text=\'\' width=\'800\' height=\'600\'} /uploads/allimg/170817/1-1FQGA116-50.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQGA116-51.jpg\' text=\'\' width=\'800\' height=\'600\'} /uploads/allimg/170817/1-1FQGA116-51.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQGA116-52.jpg\' text=\'\' width=\'800\' height=\'600\'} /uploads/allimg/170817/1-1FQGA116-52.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQGA117.jpg\' text=\'\' width=\'800\' height=\'600\'} /uploads/allimg/170817/1-1FQGA117.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQGA117-50.jpg\' text=\'\' width=\'800\' height=\'600\'} /uploads/allimg/170817/1-1FQGA117-50.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQGA117-51.jpg\' text=\'\' width=\'800\' height=\'600\'} /uploads/allimg/170817/1-1FQGA117-51.jpg {/dede:img}\r\n', '3', '4', '1', '200', '12', '', '114.241.106.181', '', '<span style=\"color: rgb(85, 85, 85); font-family: 微软雅黑; font-size: 14px; line-height: 30px;\">吸塑橱柜门板分亮光和哑光两种效果，经过一定的造型处理，时尚经典，光泽细腻，色彩柔和。门板表面光滑易清洁，没有杂乱的色彩和繁复的线条，适用于普通家庭中面积不大、设计简洁明快的厨房，一切以实用为主。</span>');
INSERT INTO `dede_addonimages` VALUES ('189', '20', '2', '800', '{dede:pagestyle maxwidth=\'800\' pagepicnum=\'12\' ddmaxwidth=\'200\' row=\'3\' col=\'4\' value=\'2\'/}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQGG511.jpg\' text=\'\' width=\'800\' height=\'600\'} /uploads/allimg/170817/1-1FQGG511.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQGG511-50.jpg\' text=\'\' width=\'800\' height=\'600\'} /uploads/allimg/170817/1-1FQGG511-50.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQGG511-51.jpg\' text=\'\' width=\'800\' height=\'606\'} /uploads/allimg/170817/1-1FQGG511-51.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQGG511-52.jpg\' text=\'\' width=\'800\' height=\'600\'} /uploads/allimg/170817/1-1FQGG511-52.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQGG511-53.jpg\' text=\'\' width=\'800\' height=\'600\'} /uploads/allimg/170817/1-1FQGG511-53.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQGG511-54.jpg\' text=\'\' width=\'800\' height=\'534\'} /uploads/allimg/170817/1-1FQGG511-54.jpg {/dede:img}\r\n{dede:img ddimg=\'/uploads/allimg/170817/1-1FQGG512.jpg\' text=\'\' width=\'800\' height=\'551\'} /uploads/allimg/170817/1-1FQGG512.jpg {/dede:img}\r\n', '3', '4', '1', '200', '12', '', '114.241.106.181', '', '<span style=\"color: rgb(85, 85, 85); font-family: 微软雅黑; font-size: 14px; line-height: 30px;\">实木多用于用料教少的品种和局部，而且贵重木材很少使用实木。例如实木餐椅比较常见，但一般是中高档的用进口榉木，中档的用枫木、桦木、国产榉木，低档的用橡胶木等。</span>');
