INSERT INTO `dede_addonimages` VALUES ('193', '30', '2', '800', '{dede:pagestyle maxwidth=\'800\' pagepicnum=\'12\' ddmaxwidth=\'200\' row=\'3\' col=\'4\' value=\'2\'/}\r\n{dede:img ddimg=\'/uploads/allimg/170819/1-1FQ9131315.jpg\' text=\'\' width=\'1538\' height=\'899\'} /uploads/allimg/170819/1-1FQ9131315.jpg {/dede:img}\r\n', '3', '4', '1', '200', '12', '', '114.241.106.181', '', '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft Yahei&quot;, arial, sans-serif; font-size: 16px; white-space: pre-wrap;\">膜压橱柜具有很好的色彩度。长时间使用不会开裂，变形程度小。采用吸塑门板一体成型，解决了封边开胶的问题。模压板抗划耐磨，耐热、耐污、防褪色，不开裂不变形。日常维护简单，因此模压板可以说是目前市场上最成熟的橱柜材料。</span>');
