INSERT INTO `dede_addonimages` VALUES ('200', '30', '2', '800', '{dede:pagestyle maxwidth=\'800\' pagepicnum=\'12\' ddmaxwidth=\'200\' row=\'3\' col=\'4\' value=\'2\'/}\r\n{dede:img ddimg=\'/uploads/allimg/170819/1-1FQ9131910.jpg\' text=\'\' width=\'1580\' height=\'815\'} /uploads/allimg/170819/1-1FQ9131910.jpg {/dede:img}\r\n', '3', '4', '1', '200', '12', '', '114.241.106.181', '', '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft Yahei&quot;, arial, sans-serif; font-size: 16px; white-space: pre-wrap;\">膜压橱柜具有很好的色彩度。长时间使用不会开裂，变形程度小。采用吸塑门板一体成型，解决了封边开胶的问题。模压板抗划耐磨，耐热、耐污、防褪色，不开裂不变形。日常维护简单，因此模压板可以说是目前市场上最成熟的橱柜材料。</span>');
INSERT INTO `dede_addonimages` VALUES ('201', '29', '2', '800', '{dede:pagestyle maxwidth=\'800\' pagepicnum=\'12\' ddmaxwidth=\'200\' row=\'3\' col=\'4\' value=\'2\'/}\r\n{dede:img ddimg=\'/uploads/allimg/170819/1-1FQ9132253.jpg\' text=\'\' width=\'1281\' height=\'929\'} /uploads/allimg/170819/1-1FQ9132253.jpg {/dede:img}\r\n', '3', '4', '1', '200', '12', '', '114.241.106.181', '', '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft Yahei&quot;, 微软雅黑, arial, 宋体, sans-serif; font-size: 16px; text-align: justify;\">造型美：因实木有很好的加工性和可塑性。所以，实木产品可以做出其它材料所做不出来的复杂造型，如雕花、多圆边、棱角的挺拔性等。色彩美：因实木来自天然，而且实木本身就有着天然的紋里与毛孔。所以，实木门板经过油漆工艺以后，可以做出很美的紋路和丰富的、充满层次的颜色，而其它材料做出的门板产品没有真正的自然紋路且颜色很单调，也不丰富和没有层次感。多元性：因为实木产品的造型变化空间与颜色变化空间很大，所以实木产品通过造型与颜色搭配，可以做出千变万化的产品效果，这种效果也是消费者所说的味道或生活方式。</span>');
INSERT INTO `dede_addonimages` VALUES ('202', '29', '2', '800', '{dede:pagestyle maxwidth=\'800\' pagepicnum=\'12\' ddmaxwidth=\'200\' row=\'3\' col=\'4\' value=\'2\'/}\r\n{dede:img ddimg=\'/uploads/allimg/170819/1-1FQ9132314.jpg\' text=\'\' width=\'1670\' height=\'857\'} /uploads/allimg/170819/1-1FQ9132314.jpg {/dede:img}\r\n', '3', '4', '1', '200', '12', '', '114.241.106.181', '', '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Microsoft Yahei&quot;, 微软雅黑, arial, 宋体, sans-serif; font-size: 16px; text-align: justify;\">造型美：因实木有很好的加工性和可塑性。所以，实木产品可以做出其它材料所做不出来的复杂造型，如雕花、多圆边、棱角的挺拔性等。色彩美：因实木来自天然，而且实木本身就有着天然的紋里与毛孔。所以，实木门板经过油漆工艺以后，可以做出很美的紋路和丰富的、充满层次的颜色，而其它材料做出的门板产品没有真正的自然紋路且颜色很单调，也不丰富和没有层次感。多元性：因为实木产品的造型变化空间与颜色变化空间很大，所以实木产品通过造型与颜色搭配，可以做出千变万化的产品效果，这种效果也是消费者所说的味道或生活方式。</span>');
