INSERT INTO `dede_addonimages` VALUES ('205', '31', '2', '800', '{dede:pagestyle maxwidth=\'800\' pagepicnum=\'12\' ddmaxwidth=\'200\' row=\'3\' col=\'4\' value=\'2\'/}\r\n{dede:img ddimg=\'/uploads/allimg/170819/1-1FQ9132A3.jpg\' text=\'\' width=\'1124\' height=\'941\'} /uploads/allimg/170819/1-1FQ9132A3.jpg {/dede:img}\r\n', '3', '4', '1', '200', '12', '', '114.241.106.181', '', '<p style=\"margin: 0px 0px 15px; padding: 0px; line-height: 24px; text-indent: 2em; zoom: 1; color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px;\">\r\n	板式家具是板件为基本结构的拆装组合式橱柜，全部经表面装饰的人造板材加<span style=\"text-indent: 2em;\">五金件连接而成的橱柜。板式橱柜具有可拆卸、造型富于变化、外观时尚、不易变形、质量稳定、价格实惠等基本特征。板式家具的结合通常采用各种金属五金件连接，装配和拆卸都十分方便，加工精度高的家具可以多次拆卸安装，方便运输，因为基材打破了木材原有的物理结构，所以在温、湿度变化较大的时候，人造板的形变要比实木好得多，质量要比实木橱柜的质量稳定。</span></p>\r\n');
