INSERT INTO `dede_addonimages` VALUES ('227', '24', '2', '800', '{dede:pagestyle maxwidth=\'800\' pagepicnum=\'12\' ddmaxwidth=\'200\' row=\'3\' col=\'4\' value=\'2\'/}\r\n{dede:img ddimg=\'/uploads/allimg/170819/1-1FQ9135214.jpg\' text=\'\' width=\'1439\' height=\'926\'} /uploads/allimg/170819/1-1FQ9135214.jpg {/dede:img}\r\n', '3', '4', '1', '200', '12', '', '114.241.106.181', '', '<span style=\"color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; text-indent: 28px;\">护墙板又称墙裙，壁板。护墙装饰板是近年来发展起来的新型装饰墙体的材料，一般采用木材等为基材。护墙装饰板具有质轻，防火、防蛀，施工简便，造价低廉，使用安全，装饰效果明显，维护保养方便等优点。它既可代替木墙裙，又可代替壁纸、墙砖等墙体材料，因此使用十分广泛。</span>');
