INSERT INTO `dede_archives` VALUES ('59', '12', '0', '1503886366', 'p', '1', '1', '0', '82', '0', '【德洛尼分享】如何才能把销售单值做大，一个卖水果的都做到了，赶紧看看吧！', '', '', 'admin', '未知', '/uploads/allimg/170731/1-1FI11G2140-L.jpg', '1503886366', '1501492459', '1', '【,德洛,尼,分享,】,如何,才,能把,销售,在,', '0', '0', '0', '0', '0', '0', '在营销界有这样一个经典案例： 一老太太去买菜，路过四个水果摊。四家卖的苹果相近，但老太太并没有在最先路过的第一家和第二家买苹果，而是在第三家买了一斤， 更奇怪的是在', '', '1', '0', '0', '57');
