INSERT INTO `dede_archives` VALUES ('183', '19', '0', '1502957069', 'p', '1', '2', '0', '62', '0', '地中海系列', '', '', '德洛尼', '未知', '/uploads/170817/1-1FQG60022A6.jpg', '1502957069', '1502956853', '1', '（北京市大兴区西红门）西红门镇欣荣北大街45号院', '0', '0', '0', '0', '0', '0', '地中海风格在造型方面，一般选择流畅的线条，圆弧形就是很好的选择，他可以放在我们家居的空间的每一个角落，一个圆弧形的拱门，一个流线型的门窗，都是地中海家装中的重要元', '', '1', '0', '0', '181');
INSERT INTO `dede_archives` VALUES ('184', '19', '0', '1502957698', 'p', '1', '2', '0', '155', '0', '美式橱柜系列1', '', '', '德洛尼', '未知', '/uploads/170817/1-1FQG6124M55.jpg', '1502957698', '1502957695', '1', '（北京市大兴区西红门）西红门镇欣荣北大街45号院', '0', '0', '0', '0', '0', '0', '讲究简洁实用：因为风格相对简洁，细节处理便显得尤为重要。美式家具一般采用胡桃木和枫木，为了突出木质本身的特点，它纹理本身成为一种装饰。可以在不同角度下产生不同的光', '', '1', '0', '0', '182');
INSERT INTO `dede_archives` VALUES ('185', '19', '0', '1502957984', 'p', '1', '2', '0', '50', '0', '美式橱柜系列2', '', '', '德洛尼', '未知', '/uploads/170817/1-1FQG6191C19.jpg', '1502957984', '1502957981', '1', '（北京市大兴区西红门）西红门镇欣荣北大街45号院', '0', '0', '0', '0', '0', '0', '崇尚古典：美式家具中常见的是新古典风格的家具。这种风格的家具，设计的重点是强调优雅的雕刻和舒适的设计。在保留了古典家具的色泽和质感的同时，又注意适应现代生活空间。', '', '1', '0', '0', '183');
INSERT INTO `dede_archives` VALUES ('186', '19', '0', '1502958359', 'p', '1', '2', '0', '96', '0', '欧式橱柜系列', '', '', '德洛尼', '未知', '/uploads/170817/1-1FQG62454960.JPG', '1502958359', '1502958354', '1', '（北京市大兴区西红门）西红门镇欣荣北大街45号院', '0', '0', '0', '0', '0', '0', '欧式风格家居装修装饰装潢设计理念独特，欧式风格线角变化丰富，家具及灯饰都略显欧式特色并有一定的文化氛围。现代欧式的居室有的不只是豪华大气，更多的是惬意和浪漫。通过', '', '1', '0', '0', '184');
INSERT INTO `dede_archives` VALUES ('187', '20', '0', '1502959527', 'p', '1', '2', '0', '62', '0', '电脑桌系列', '', '', '德洛尼', '未知', '/uploads/170817/1-1FQG6442O09.jpg', '1502959527', '1502959525', '1', '（北京市大兴区西红门）西红门镇欣荣北大街45号院', '0', '0', '0', '0', '0', '0', '电脑桌的颜色也要考虑与环境相宜，可以选用比较高贵典雅的色调以显出你的气质和地位，比较常见的有黑白两色。在自己的家里，最主要的是要突出自己的个性，可以按自己的喜好随', '', '1', '0', '0', '185');
INSERT INTO `dede_archives` VALUES ('188', '20', '0', '1502959922', 'p', '1', '2', '0', '50', '0', '吸塑系列', '', '', '德洛尼', '未知', '/uploads/170817/1-1FQGA05Q03.JPG', '1502959922', '1502959920', '1', '（北京市大兴区西红门）西红门镇欣荣北大街45号院', '0', '0', '0', '0', '0', '0', '吸塑橱柜门板分亮光和哑光两种效果，经过一定的造型处理，时尚经典，光泽细腻，色彩柔和。门板表面光滑易清洁，没有杂乱的色彩和繁复的线条，适用于普通家庭中面积不大、设计', '', '1', '0', '0', '186');
INSERT INTO `dede_archives` VALUES ('189', '20', '0', '1502961329', 'p', '1', '2', '0', '71', '0', '实木系列', '', '', '德洛尼', '未知', '/uploads/170817/1-1FQGG456461.JPG', '1502961329', '1502961314', '1', '（北京市大兴区西红门）西红门镇欣荣北大街45号院', '0', '0', '0', '0', '0', '0', '实木多用于用料教少的品种和局部，而且贵重木材很少使用实木。例如实木餐椅比较常见，但一般是中高档的用进口榉木，中档的用枫木、桦木、国产榉木，低档的用橡胶木等。', '', '1', '0', '0', '187');
