INSERT INTO `dede_arctype` VALUES ('8', '1', '1', '1', '公司简介', '{cmspath}/a/gywm/gsjj', '1', 'index.html', '1', '1', '-1', '0', '0', 'default/article_aboutus.htm', 'default/article_aboutus.htm', 'default/article_aboutus.htm', '{typedir}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '', '', '公司简介', '0', '{cmspath}/a/gywm', '', '0', '0', '', '<h3>\r\n	公司简介</h3>\r\n<p>\r\n	德洛尼全屋定制作为最早一批推行全屋定制的家居企业，随同行业发展的潮流，在定制家居的变革中，率先实行了柔性化生产、智能制造、前后端一体化、产品结构调整、人才储备、营销机能转变等几大发展战略，进行了全新的立体布局调整和创新升级，将开启一个快速发展的新纪元。</p>\r\n<h4>\r\n	柔性化生产</h4>\r\n<p>\r\n	德洛尼使用了信息智能化生产管理体系，与宏光软件公司合作，开发了一套集设计、生产、销售一体化的软件系统。专卖店设计端使用软件，可以在30分钟内快速设计出整个全屋定制产品的效果图，并可转换成cad图形。然后输入价格，可以马上给客户产生报价；</p>\r\n<p>\r\n	设计师把订单图形传到公司，公司的人员利用订单中央处理系统，把订单图按门板、柜体、五金进行分类拆单，拆单后，再进行多单合并，优化出材料清单、孔位图，同时生成各个板件的二维码，形成数据库。</p>\r\n<p>\r\n	生产端直接导出数据库的信息即可自动生产，生产出的每个板件都有一个二维码，里面记载着客户名、孔位图、尺寸、封边等信息，根据这些信息，实行板件的分类、各环节的加工，直到包装发货。</p>\r\n<p>\r\n	柔性化生产，将本来非标定制的高难度加工，变成了可以规模化的高速制造，大大节约了成本，提高了效率，降低了定制行业致命的出错率，这也是定制行业的一种革命。</p>\r\n<p>\r\n	目前，公司的柔性化生产水平只达到定制3.0的水平，我们将对软件和自动化设备进一步升级，争取3年内达到定制4.0的水平，成为行业的领军者。</p>\r\n<h4>\r\n	智能制造</h4>\r\n<p>\r\n	德洛尼将生产流程的关键工序开料、排孔、铣型都使用了智能化的机器人，加工精密度高，安全性大，大大减少了人工数量，效率显著提高。</p>\r\n<p>\r\n	通过二维码扫码识别，中央数据处理系统对数据信息的集合处理，精准快速，把工人从复杂繁重的操作中解放出来。</p>\r\n<p>\r\n	我们继续将加大流程的改造，把所有工序都使用机器人代替，除进料和出货环节外，全部实行智能自动化制造。</p>\r\n<h4>\r\n	前后端一体化</h4>\r\n<p>\r\n	德洛尼逐步推动物联网建设，把生产现场和终端客户电脑或手机进行网络链接，让客户随时可以查看自己的产品加工情况，使客户买的放心。</p>\r\n<p>\r\n	终端使用者也可以把安装现场或产品传送到公司客服端，公司可以随时检查产品的安装质量和服务满意度，更快更好的掌握客户的反馈信息，并能迅速的作出反应。</p>\r\n<h4>\r\n	产品结构调整</h4>\r\n<p>\r\n	德洛尼全屋定制坚持产品创新和差异化策略，每年都要开发推出2至3款新产品，保持产品的新颖度、独特性、差异性，增加产品的吸引力和竞争力，</p>\r\n<p>\r\n	公司和韩国LG公司、台湾好奇、百隆、爱格等国际领先品牌合作，使用前沿的花色、新颖的材料、流行的款式、先进的工艺品质和独特的设计。</p>\r\n<p>\r\n	今年公司在行业里率先使用了环保的水性油漆，采购了先进的红外线烘干机，把实木产品的环保性大大提高了，达到了国家的产业要求。使用红外线烘干机，可以在10秒内烘干油漆产品，把实木封闭油漆系列产品的加工工期缩短到15天，实行了革命性的突破。</p>\r\n<p>\r\n	公司实行全屋定制生产后，从原来的橱柜和衣柜产品，逐步延伸了护墙板、酒柜、鞋柜、榻榻米、餐边柜、电视柜、浴室柜、玄关柜、门厅柜等全屋系列产品，大大丰富了产品菜单，给客户提供了更多的选择空间。让经销商的订单单值增加了好几倍，最重要的是给客户提供更系统全面的设计与产品服务，让消费者获得很高的满意度。</p>\r\n<h4>\r\n	人才储备</h4>\r\n<p>\r\n	为了确保公司的快速发展，我们将加大两方面人才的培育：</p>\r\n<p>\r\n	一、 设计师队伍，培养展厅设计、产品设计、购物环境设计、流程设计等各方面的设计人才，逐步实行产品设计的原创性和先进性。</p>\r\n<p>\r\n	二、 管理型人才</p>\r\n<p>\r\n	1、 生产流程管理人才，柔性化生产和智能化制造需要懂管理、技术、电脑、自动化等全面型人才，没有这些人才队伍，很难保证整个系统的良好运行，也跟不上发展的需要。</p>\r\n<p>\r\n	2、 营销管理型人才，全屋定制的兴起，对营销人员提出了更高的要求，对产品的设计、产品的特性、客户的需求、广告宣传、地面推广、软件应用、促销活动的举办、终端培训等专业技能都必须全面掌握，没有这种综合性人才，市场的竞争力会大大降低。德洛尼必须加大这类人才的培育，适应市场发展的需要。</p>\r\n<h4>\r\n	营销机能转变</h4>\r\n<p>\r\n	全屋定制家居的推行，德洛尼从2年前就开始对专卖店进行升级改造，注入了新形象、新品牌文化、新产品和新资料，宣传图册全新改版，今年公司又办了传播厂商文化的德洛尼全屋定制报刊，增加了微信公众平台和企业版易起秀的网络宣传。并且打造了不少的大店和旗舰形象店，德洛尼逐步把原来主战场三四线城市转向一二级城市，每年平均增加30多家专卖店，实行市场的全面布局。</p>\r\n<p>\r\n	专卖店终端营销，过去实行指导帮扶的服务方法，现在进行了转变，公司带领团队到现场帮助经销商策划、培训、执行和销售跟踪，以完成实际的业绩来帮助经销商提升销量，带领终端队伍学习成长。培养终端队伍从不会到会，从会到强的转变，最大程度降低经销商的加盟压力，让加盟商快速步入财富倍增的快车道。</p>\r\n<p>\r\n	德洛尼长期与家居热线战略合作，进行网络推广和招商。同时，经常要在新浪、搜狐、搜房网、中国建材网等各个知名媒体进行报道宣传，公司在高速路口、高铁、城市广场多处投放广告，不断提升品牌知名度，聚焦发力冲刺进入定制行业一线品牌。</p>\r\n<p>\r\n	这是充满机遇的时代，也是一个危机四伏的时代，德洛尼以不变应万变，整合资源，调整策略，在定制家居的大海里，乘风破浪，长驱直行，打造美好未来。</p>\r\n', '', '/uploads/170818/1-1FQR00T4G6.jpg');
INSERT INTO `dede_arctype` VALUES ('9', '1', '1', '2', '品牌诠释', '{cmspath}/a/gywm/ppqs', '1', 'index.html', '1', '1', '-1', '0', '0', 'default/article_aboutus.htm', 'default/article_aboutus.htm', 'default/article_aboutus.htm', '{typedir}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '', '', '品牌诠释', '0', '{cmspath}/a/gywm', '', '0', '0', '', '<p>\r\n	德洛尼橱柜品牌，对&ldquo;德洛尼&rdquo;三个字造字本义的诠释；<br />\r\n	德：造字本义；看清道路方向，没有困惑迷误，大道坦然执行。<br />\r\n	德：境界因善行而升华，代表顺应自然规律的法则，是道家方法论的核心。<br />\r\n	洛：造字本义；突破河界，进犯他邑。<br />\r\n	洛：称为河川，源出左冯翊归德北夷界中，向东南流入渭河。<br />\r\n	尼：造字本义；与人亲切，小而雅之意。<br />\r\n	尼：亲近，亲昵。<br />\r\n	公司选&ldquo;德洛尼&rdquo;作为品牌的名称指的是：企业会以顺应自然律的法则，用善行突破市场，把产品走进千家万户，富有生命力的产品，让主人用起来更亲近、亲昵~~~~~~</p>\r\n', '', '/uploads/170719/1-1FGZ94TKb.png');
