INSERT INTO `dede_arctype` VALUES ('11', '1', '1', '4', '总裁致辞', '{cmspath}/a/gywm/zczz', '1', 'index.html', '1', '1', '-1', '0', '0', 'default/article_aboutus.htm', 'default/article_aboutus.htm', 'default/article_aboutus.htm', '{typedir}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '', '', '总裁致辞', '0', '{cmspath}/a/gywm', '', '0', '0', '', '<p>\r\n	尊敬的各位商界同仁、朋友们：<br />\r\n	您们好！<br />\r\n	欢迎访问我公司网站，我们期待各方朋友的了解与真诚合作！<br />\r\n	我们之间的友谊及合作，从您打开这网页的时候就开始了。无论您是在遥远的大洋彼岸，还是身处附近的城区，您将会认识到一个锐意进取、持续创新、致力于为客户创造价值的企业。<br />\r\n	在艰苦创业的历程中，德洛尼橱柜始终坚持&ldquo;以做人为宗旨&rdquo;、&ldquo;以品质为导向&rdquo;、&ldquo;以服务为目标&rdquo;的经营理念，始终把目光聚焦在客户身上，为客户和社会提供价值最大化的产品和服务，打造与合作伙伴共享成功的价值链。怀着对中国定制行业的发展具有强烈的使命感和责任感，德洛尼始终致力于推动中国定制家居走向原创化、规范化、普及化、成熟化。将德洛尼橱柜建设成为中国一流的专业橱柜生产商。我们期待您的来访和留言，这将是我们互相沟通和实现共赢的开始与延续。</p>\r\n', '', '/uploads/170719/1-1FGZ949332C.png');
